import React, { useState } from "react";

const AddServTrans = ({ sessionUser }) => {
  const [propertyCode, setPropertyCode] = useState("");
  const [formData, setFormData] = useState({
    tenancy_contract_number: "",
    service_request_type: "",
    service_request_description: "",
    service_request_login_date: "",
    service_request_attended_by: "",
    service_request_start_date: "",
    service_request_estimated_cost: "",
    service_request_actual_cost: "",
    service_request_end_date: "",
    description: "",
    status_of_service_request: "OP",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const form = new FormData();
    form.append("property_code", propertyCode);
    form.append("created_by", sessionUser || "Admin");

    Object.keys(formData).forEach((key) => {
      form.append(key, formData[key]);
    });

    try {
      const response = await fetch("http://localhost:5000/add_servtrans", {
        method: "POST",
        body: form,
      });
      const data = await response.json();
      alert(data.message);
    } catch (error) {
      alert("Error submitting service transaction!");
      console.error(error);
    }
  };

  return (
    <div className="p-6 bg-gray-100 rounded-xl max-w-3xl mx-auto shadow-lg">
      <h2 className="text-2xl font-bold mb-4 text-center text-blue-700">
        ðŸ§° Add Service Transaction
      </h2>

      <form onSubmit={handleSubmit} className="space-y-4">
        <div>
          <label>Property Code:</label>
          <input
            type="text"
            className="border p-2 rounded w-full"
            value={propertyCode}
            onChange={(e) => setPropertyCode(e.target.value)}
            required
          />
        </div>

        <div>
          <label>Tenancy Contract Number:</label>
          <input
            type="number"
            name="tenancy_contract_number"
            className="border p-2 rounded w-full"
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Service Request Type:</label>
          <select
            name="service_request_type"
            className="border p-2 rounded w-full"
            value={formData.service_request_type}
            onChange={handleChange}
            required
          >
            <option value="">-- Select --</option>
            <option value="PL">Plumbing</option>
            <option value="PA">Painting</option>
            <option value="CL">Cleaning</option>
            <option value="DA">Damages</option>
            <option value="EL">Electrical</option>
            <option value="OT">Other</option>
          </select>
        </div>

        <div>
          <label>Description:</label>
          <input
            type="text"
            name="service_request_description"
            className="border p-2 rounded w-full"
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Estimated Cost:</label>
          <input
            type="number"
            name="service_request_estimated_cost"
            className="border p-2 rounded w-full"
            step="0.01"
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Actual Cost:</label>
          <input
            type="number"
            name="service_request_actual_cost"
            className="border p-2 rounded w-full"
            step="0.01"
            onChange={handleChange}
          />
        </div>

        <div>
          <label>Status:</label>
          <select
            name="status_of_service_request"
            className="border p-2 rounded w-full"
            value={formData.status_of_service_request}
            onChange={handleChange}
          >
            <option value="OP">Open</option>
            <option value="IP">In Progress</option>
            <option value="CL">Closed</option>
          </select>
        </div>

        <button
          type="submit"
          className="bg-blue-600 text-white p-2 rounded w-full hover:bg-blue-700 transition"
        >
          Add Service Transaction
        </button>
      </form>
    </div>
  );
};

export default AddServTrans;
